import React from 'react'; 
const Navbar = () => {
    return (
      <div className = "menubar center">
        <img src="logo.png"></img>
        <ul className="menu">
          <li><a href="/">Главная</a></li>
          <li><a href="/courses">Все курсы</a></li>
          <li><a href="/aboutTeam">О нас</a></li>
        </ul>
      </div>
    )
}

export default Navbar;
